import dash
import dash_core_components as dcc
import dash_html_components as html
from dash.dependencies import Input, Output
import classification as cl
from tkinter import filedialog
import tkinter


app = dash.Dash()
im10='data:image/png;base64,'
im1='https://upload.wikimedia.org/wikipedia/en/thumb/b/b8/GGSIU_logo.svg/1200px-GGSIU_logo.svg.png'
im2='https://upload.wikimedia.org/wikipedia/commons/thumb/f/f8/Python_logo_and_wordmark.svg/2000px-Python_logo_and_wordmark.svg.png'
im3='http://www.youreyescenter.com/images/Fundus.png'



        

app.layout = html.Div([
    html.H1(children=' Retinopathy Diabetic Detection ', style={'marginBottom': '12px'}),
    html.Div(children = [html.Img(src=im1,style={'width': '20%', 'marginLeft': 'auto', 'marginRight': 'auto'}),
                         html.Img(src=im2,style={'width': '20%', 'marginLeft': 'auto', 'marginRight': 'auto'}),
                         html.Img(src=im3,style={'width': '20%', 'marginLeft': 'auto', 'marginRight': 'auto'})]),
    html.H2(" Please Select Image to Test ",style={'marginBottom': '4px'}),
    html.Button(id='submit-button', n_clicks=0, children='Upload', 
    style={'marginTop': 15, 'marginBottom': 25}),
    html.Div(id='my-div'),
], style={'textAlign': 'center'})

app.css.append_css({"external_url": "https://codepen.io/chriddyp/pen/bWLwgP.css"})


@app.callback(
    Output(component_id='my-div', component_property='children'),
    [Input(component_id='submit-button', component_property='n_clicks')]
)
def update_output_div(n_clicks):
    if n_clicks > 0:
        root = tkinter.Tk()
        root.filename =  filedialog.askopenfilename(initialdir = "C:/Users/CHANDA/Desktop/Retinology/Test",title = "Select file",filetypes = (("Image files","*.jpg"),("Image files","*.JPG"),("all files","*.*")))
        root.destroy()
        out = cl.main(root.filename)
        return html.H1(children='Selected Image is  ' + str(out), style={'marginBottom': '14px'})


if __name__ == '__main__':
    app.run_server()
        
